using namespace std;
 
class ColoredStrokes {
public:
  int getLeast(vector <string>);
};
 
int ColoredStrokes::getLeast(vector <string> s) {
  int n = s.size(), m = s[0].length(), i, j, ans = 0;
  for (i=0;i<n;i++)
    for (j=0;j<m;j++)
      if (s[i][j] == 'R' || s[i][j] == 'G')
        if (j == 0) ans++; else
        if (s[i][j-1] == 'B' || s[i][j-1] == '.') ans++;
  for (j=0;j<m;j++)
    for (i=0;i<n;i++)
      if (s[i][j] == 'B' || s[i][j] == 'G')
        if (i == 0) ans++; else
        if (s[i-1][j] == 'R' || s[i-1][j] == '.') ans++;
  return ans;
}
 
 
